    'Security Off -> No filtering of inbound or outbound traffic.        \nLow Security -> Inbound traffic is blocked based on the settings under \'Service Blocking\'. Outbound traffic is not blocked.        \nMedium Security -> Inbound traffic is blocked based on the settings under \'Service Blocking\'. Outbound traffic is not blocked. There is more inbound traffic blocked when compared to \'Low Security\'.        \nHigh Security -> Inbound traffic is blocked based on the settings under \'Service Blocking\'. Outbound traffic is blocked based on the settings under \'Service Blocking\' including DNS.': 'Sécurité désactivée -> Aucun filtrage du trafic entrant ou sortant.\nFaible sécurité -> Le trafic entrant est bloqué en fonction des paramètres «Blocage de service». Le trafic sortant n\'est pas bloqué.\nMoyenne sécurité -> Le trafic entrant est bloqué en fonction des paramètres «Blocage de service». Le trafic sortant n\'est pas bloqué. Il y a plus de trafic entrant bloqué par rapport à «Faible sécurité».        \nHaute sécurité -> Le trafic entrant est bloqué en fonction des paramètres «Blocage de services». Le trafic sortant est bloqué en fonction des paramètres «Blocage de services», y compris DNS.',
